import React from 'react';
import '../style.css';

export default function BackgroundVideo() {
    return (
        <div>
            <video loop autoPlay muted id="bg-video">
                <source src={require('../images/bg_video.mp4')} type="video/mp4" />
            </video>
            <p>hello</p>
        </div>
    )
}
